import React from 'react';
import { Dropdown, ButtonGroup } from 'react-bootstrap';
import { useDispatch } from 'react-redux';
import { actions as modalAction } from '../slices/Modals.js';

const DropdownItem = () => {
  const dispatch = useDispatch();

  const trailer = () => {
    dispatch(modalAction.openModal({ type: 'rename' }));
  };
  const lore = (id) => {
    dispatch(modalAction.openModal({ type: 'remove', id }));
  };
  const gallery = () => {
    dispatch(modalAction.openModal({ type: 'gallery' }));
  };
  return (
    <Dropdown as={ButtonGroup} className="d-flex" data-bs-theme="dark">
      <Dropdown.Toggle
        key="up"
        id="dropdown-button-drop-up"
        drop="up"
        variant="col-12 col-md-12 secondary dark gradient bg-gradient"
        title="Загляни сюда"
      />
      <Dropdown.Menu className="btn-primary">
        <Dropdown.Item eventKey="1" onClick={trailer}>Трейлер</Dropdown.Item>
        <Dropdown.Item eventKey="2" onClick={lore}>Лор</Dropdown.Item>
        <Dropdown.Item eventKey="3" onClick={gallery}>Галерея</Dropdown.Item>
        <Dropdown.Divider />
        <Dropdown.Item eventKey="4">Помощь проекту</Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  );
};

export default DropdownItem;
